import { createSelector } from 'reselect';

import { FilmState } from './cart.reducer';
import { RootState } from '../store';


// const selectFilmReducer = (state: RootState): FilmState => state.film;
const selectFilmReducer = (state) => state.film;

export const selectFilmItems = createSelector(
  [selectFilmReducer],
  (film) => film.filmItems
);
